import React, { Component } from 'react';
import './App.css';
import FilmListing from './FilmListing';
import FilmDetails from './FilmDetails';

class App extends Component {
  render() {
    return (
      <div>
        <FilmListing />
        <FilmDetails />
      </div>
    );
  }
}

export default App;
